import React from 'react'

import s from './ToDo.module.css'

const ToDo = () => {
    return (
      <div className={s.container}>
        <div className={s.inner}>
          <p className={s.title}>Что ещё можно сделать?</p>
          <p className={s.text}></p>
        </div>
      </div>
    );
}

export default ToDo
